    const [text,setText] = useState('')
  return (
    <div className="bckgrnd">
        <div className = "flex-grow-1 overflow-auto"></div>
        <div>
      <Form>
        <Form.Group className>
          <InputGroup>
            <Form.Control as ="textarea" required value ={text} onChange={e =>setText(e.target.value)} style ={{height : '75px', resize : 'none'}}></Form.Control>
          </InputGroup>
        </Form.Group>
      </Form>
        </div>
    </div>
  );
};

export default MainConversation;
